export const CartItem = (props) => {
    const { title, price, imgUrl} = props.data;
    return (
        <div className="cart-item">
        <img src={imgUrl} alt="product" />
            <div className="description">
                <p>
                    { " " } 
                    <b>{title}</b>
                </p>
                <p>NOK {price},-</p>
            </div>
        </div>
    )
};
